import React from "react";
import {
  View,
  Text,
  TextInput,
  StyleSheet,
  TouchableOpacity,
  Button,
} from "react-native";
import { useDispatch } from "react-redux";

export default function SearchBar(props) {

  const dispatch = useDispatch()

  const click = () => {
    dispatch({})
  };

  return (
    <View style={styles.container}>
      <TextInput style={styles.searchInp} placeholder="Search products..." />
      <View style={styles.buttons}>
        <Button title=" X " onPress={click}></Button>
        <Button title=" S "></Button>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    margin: 10,
  },
  searchInp: {
    flex: 0.75,
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 10,
    paddingHorizontal: 10,
    paddingVertical: 5,
    marginEnd: 5,
  },
  buttons: {
    flexDirection: "row",
    justifyContent: "space-around",
    flex: 0.25,
  },
});
